import React, { useState } from 'react';


const App = () => {
    const state = useState();
     const [count]=useState

    

    const IncNum = () => {
        count++;
        console.log("Clicked :" + count)
    }
    return (
        <>



            <h1>{count}</h1>
            <button onClick={IncNum}>Click Me</button>
        </>
    );
};
export default App;
